-- title:  Dog-Venture
-- author: Hot Ramen Studios
-- desc:   Dog Adventure
-- script: lua

function init()
	solids={[5]=true,[6]=true}
	gravity=9.81/30
 friction=5
 camerax=0
 game_running=false
 game_win=false
 draw_title=true
 title_tick=0
 title_action_color=0
 frame_count=0
 game_score=0
 score_count=0
 music_started=false
	world_floor_height=100
	
	player={}
		player.width=2
		player.height=2
		player.width_pixel=8*player.width
		player.x=120
		player.y=65
		player.vx=0
		player.vy=0
		player.sprite=260
		player.step=0
  player.direction=1
  player.airborn=false
  player.acceleration=2
  player.jump=5
		player.max_speed=2
		player.speed={}
	 player.speed.x=0
	 player.speed.y=0
		player.moving=false
  player.stopped=true
  player.dead=false
  player.barking=false
		player.flip=0
	
	screen={}
		screen.width=30
		screen.height=17
		screen.width_pixel=8*screen.width-player.width_pixel
		screen.hight_pixel=8*screen.height
		screen.x=0
		screen.y=0
	
	game={}
		game.lvl=0
end


init()

function solid(x,y)
	return solids[mget((x)//8,(y)//8)]
end

function move()
 player.moving=true
 player.stopped=false
end

function animate_move()
	--cycles sprites when moving
 player.step=player.step+1
	if(player.step%6==0) then player.sprite=player.sprite+2 end
	if(player.sprite>258) then player.sprite=256 end
end

function player_movement()
	--buttons to move and bark
	--left
	if btn(2) then
		player.direction=0
  	player.speed.x=player.speed.x-player.acceleration
    animate_move()
   move()
	--right
	elseif btn(3) then
  player.direction=1
   player.speed.x=player.speed.x+player.acceleration
    animate_move()
   move()
	end
	--down
	if btn(1) then
  player.speed.y=player.speed.y+player.acceleration
  player.step=0
  player.sprite=264
  player.stopped=false
 end
	--up
	if btn(0) and not player.airborn then
  player.airborn=true
  player.speed.y=player.jump*-1
   player.step=0
  player.stopped=false
 end
	--bark with z
	if btnp(4) and not player.barking then
  player.barking=true
  player.stopped=false  
  sfx(0)
 end
end

function player_stopped()
	--stnading sprite
	if player.stopped then
  player.step=0
  player.sprite=260
 end
end

function player_jump()
	--jump animation
	if player.airborn and not player.barking then
  player.sprite=262
 end
end

function player_bark()
	--bark animation
	if player.barking then
  if player.airborn then
   player.sprite=270
  else
  	player.sprite=268
  end
  frame_count=frame_count+1
  if frame_count>8 then
   frame_count=0
   player.barking=false
  end
	end
end

function player_speed()
	--player movement speed
	if player.speed.x>player.max_speed then
 	player.speed.x=player.max_speed
 end
 if player.speed.x<player.max_speed*-1 then
  player.speed.x=player.max_speed*-1
 end
 player.x=player.x+player.speed.x
 player.y=player.y+player.speed.y
end

function apply_gravity()
	--apply gravity
 player.speed.y=player.speed.y+gravity
end

function apply_friction()
	--apply friction
	if not player.airborn and not btn(2) and not btn(3) then
  player.speed.x=player.speed.x/friction
 end
end

function player_position()
	--checking player position against screen bounds
	if player.x<0 then
	 player.x=0
	 player.dead=true
	end
	if player.x+player.width>screen.width_pixel then
	 player.x=screen.width_pixel-player.width
	 player.dead=true
	end
	if player.y<0 then
	  player.y=0
	end
end

function player_facing()
	--change sprite with facing
	if player.direction==1 then
		player.flip=0
	else
		player.flip=1
	end
end

function TIC()
	map(screen.x, screen.y, screen.width, screen.height)
	spr(player.sprite, player.x, player.y, 0, 1, player.flip, 0, player.width, player.height)

	player.moving=false
 player.stopped=true

	player_movement()
	player_stopped()
	player_jump()
	player_bark()
	player_speed()
	
	apply_gravity()
	apply_friction()
	
	player_position()
	player_facing()
	
	--check collision
	--check sides
	if solid(player.x+player.speed.x,player.y+player.speed.y) 
		or solid(player.x+15+player.speed.x,player.y+player.speed.y)
		or solid(player.x+player.speed.x,player.y+15+player.speed.y) 
		or solid(player.x+15+player.speed.x,player.y+15+player.speed.y) then
   player.speed.x=0
			player.airborn=false
	end
	--check bottom
	if solid(player.x+player.speed.x,player.y+15) 
		or solid(player.x+15+player.speed.x,player.y+15) then
  	player.speed.y=0
			player.airborn=false
	end
end

